/* ai-robot-avatar.js - 3D Avatar (embedded PNG, no external files) */
(function () {
  'use strict';

  var DATA_URI = "data:image/png;base64,";

  function ensureStyle() {
    if (document.getElementById('aiRobot3DPNGStyle')) return;
    var css = `
.avatar{ position:relative; overflow:hidden !important; border-radius:999px; }
.avatar img{ opacity:0 !important; pointer-events:none; }

.ai-robot-3d-png{
  position:absolute; inset:0;
  border-radius:999px;
  overflow:hidden;
  pointer-events:none;
  z-index: 9999;
}
.ai-robot-3d-png img{
  width:100%;
  height:100%;
  object-fit: cover;
  display:block;
  transform: scale(1.10);
  filter: drop-shadow(0 10px 16px rgba(0,0,0,0.55)) saturate(1.05);
  will-change: transform, filter;
}

.ai-robot-3d-png.is-idle img{ animation: rbIdle 6.5s ease-in-out infinite; }
@keyframes rbIdle{ 0%,100%{ transform: scale(1.10) translateY(0); } 50%{ transform: scale(1.12) translateY(-2px); } }

.ai-robot-3d-png.is-wave img{ animation: rbWave 900ms ease-in-out both; }
@keyframes rbWave{ 0%{transform:scale(1.10) rotate(0)} 25%{transform:scale(1.12) rotate(5deg)} 55%{transform:scale(1.12) rotate(-4deg)} 80%{transform:scale(1.12) rotate(4deg)} 100%{transform:scale(1.10) rotate(0)} }

.ai-robot-3d-png.is-point img{ animation: rbPoint 900ms cubic-bezier(.22,.61,.36,1) both; }
@keyframes rbPoint{ 0%{transform:scale(1.10) translate(0,0)} 60%{transform:scale(1.12) translate(6px,6px)} 100%{transform:scale(1.10) translate(0,0)} }

.ai-robot-3d-png.is-wink img{ animation: rbWink 650ms ease-in-out both; }
@keyframes rbWink{ 0%{filter: drop-shadow(0 10px 16px rgba(0,0,0,0.55))} 45%{filter: drop-shadow(0 10px 16px rgba(0,0,0,0.55)) brightness(1.10) contrast(1.05)} 100%{filter: drop-shadow(0 10px 16px rgba(0,0,0,0.55))} }

@media (prefers-reduced-motion: reduce){
  .ai-robot-3d-png.is-idle img,
  .ai-robot-3d-png.is-wave img,
  .ai-robot-3d-png.is-point img,
  .ai-robot-3d-png.is-wink img{ animation:none !important; }
}
`;
    var style = document.createElement('style');
    style.id = 'aiRobot3DPNGStyle';
    style.textContent = css;
    document.head.appendChild(style);
  }

  function mount(imgId) {
    var img = document.getElementById(imgId);
    if (!img) return;
    var avatar = img.closest('.avatar');
    if (!avatar) return;

    ensureStyle();

    if (avatar.querySelector('.ai-robot-3d-png')) return;

    img.style.opacity = '0';

    var wrap = document.createElement('div');
    wrap.className = 'ai-robot-3d-png is-idle';

    var robotImg = document.createElement('img');
    robotImg.alt = 'AI Robot';
    robotImg.src = DATA_URI;

    wrap.appendChild(robotImg);
    avatar.appendChild(wrap);

    function seq(){
      wrap.classList.remove('is-wave','is-point','is-wink');
      setTimeout(function(){ wrap.classList.add('is-wave'); }, 350);
      setTimeout(function(){ wrap.classList.remove('is-wave'); wrap.classList.add('is-point'); }, 1600);
      setTimeout(function(){ wrap.classList.remove('is-point'); wrap.classList.add('is-wink'); }, 2850);
      setTimeout(function(){ wrap.classList.remove('is-wink'); }, 3600);
    }

    setTimeout(seq, 1200);
    setInterval(seq, 26000);
  }

  document.addEventListener('DOMContentLoaded', function () {
    mount('mine-avatar');
    mount('account-avatar');
  });
})();
